@ganjarpranowo beribadah haji menuai sentimen negative warganet setelah terbaca menghilangkan bagian gambar @aniesbaswedan. Sebagian besar warganet beremosi kaget/terkejut dgn bobot 44%. Saat menanggapi unggahan tersebut, warganet cenderung berkarakter emosional dibandingkan rasional dan berkomunikasi menggunakan gaya bahasa opini/pendapat pribadi. Unggahan ini berdampak buruk bagi brand @PDI_Perjuangan & @ganjarpranowo
karena terdeteksi detract, dan psikografis yg terbentuk cenderung at-risk yg berarti para merasa frustrasi/kecewa mendalam karena tidak terpenuhinya harapan mereka.

